INSERT INTO `tax_code` (`id`, `tax_type_id`, `name`, `code`, `description`, `rate`, `vendor_id`, `customer_id`) VALUES
	(1, 3, 'Non Taxable', 'N-T', 'Bebas Pajak', 0, NULL, NULL),
	(2, 4, 'Pajak Pertambahan Nilai', 'PPN', 'Pemotongan: Tarif 10%. PPN atau Pajak Pertambahan Nilai adalah jenis pajak yang disetor dan dilaporkan pihak penjual yang telah dikukuhkan sebagai Pengusaha Kena Pajak (PKP). \r\n\r\nPelaporan: Batas waktu penyetoran dan pelaporan PPN adalah setiap akhir bulan. Sejak tanggal 1 Juli 2016, PKP se-Indonesia wajib membuat e-Faktur atau faktur pajak elektronik sebagai prasyarat pelaporan SPT Masa PPN. \r\n\r\nInfo: Pajak keluaran adalah PPN yang dipungut ketika PKP menjual produknya. Pajak masukan ialah PPN yang dibayar ketika PKP membeli, memperoleh maupun membuat produknya.', 10, NULL, NULL),
	(4, 2, 'Pajak Penghasilan Pasal 23', 'PPh 23', 'Pemotongan:  Tarif 2% dari jumlah bruto atas imbalan jasa lainnya adalah yang diuraikan dalam Peraturan Menteri Keuangan No. 141/PMK.03/2015 dan efektif mulai berlaku pada tanggal 24 Agustus 2015.\r\n\r\nPelaporan:  Dilakukan oleh pihak pemotong. Jatuh tempo pelaporan adalah tanggal 20, sebulan setelah bulan terutang pajak penghasilan 23.', 2, NULL, NULL),
	(5, 2, 'Pajak Penghasilan 4 Ayat 2', 'PPh 4 (2)', 'Pemotongan: Persewaan tanah dan/atau bangunan. Tarif 10%.\r\n\r\nPenyetoran: Tanggal 10 (bagi Pemotong Pajak) atau tanggal 15 (bagi WP pengusaha persewaan) dari bulan berikutnya setelah masa pajak berakhir. \r\n\r\nPelaporan: 20 hari setelah masa pajak berakhir.', 10, NULL, NULL),
	(6, 2, 'Pajak Penghasilan Pasal 15 (Asing)', 'PPh 15 (2.64%)', 'Pemotongan: Untuk perusahaan pelayaran asing atau maskapai asing, perhitungan pajak penghasilannya adalah 2,64% x Omzet Bruto.\r\n\r\nPelaporan: Untuk jenis perusahaan pelayaran dalam negeri ataupun asing serta penerbangan asing, pembayaran dilakukan paling lambat tanggal 10 pada bulan yang sama setelah faktur dibuat. Boleh dibayarkan pemungut cukai atau bisa juga dibayar sendiri oleh wajib pajak pada tanggal 15 di bulan yang sama setelah faktur dibuat.', 2.64, NULL, NULL),
	(7, 2, 'Pajak Penghasilan Pasal 15 (Dalam Negeri)', 'PPh 15 (1.2%)', 'Pemotongan: Untuk perusahaan pelayaran dalam negeri pajak penghasilannya adalah 1,2% x Omzet Bruto.\r\n\r\nPelaporan: Untuk jenis perusahaan pelayaran dalam negeri ataupun asing serta penerbangan asing, pembayaran dilakukan paling lambat tanggal 10 pada bulan yang sama setelah faktur dibuat. Boleh dibayarkan pemungut cukai atau bisa juga dibayar sendiri oleh wajib pajak pada tanggal 15 di bulan yang sama setelah faktur dibuat.', 1.2, NULL, NULL);
